//       <a style={linkStyle}>Home</a>
//     </Link>
//     <Link href="/family">
//       <a style={linkStyle}>About</a>
//     </Link>
//   </div>
// );


const MenuList = ({id, classes}) => {
    return (
        <ul id={id} className={classes}>
          <li>
            <a href="">Home</a>
          </li>
          <li>
            <a href="#features">Products</a>
          </li>
          <li>
            <a href="#about">Who We Are</a>
          </li>
          <li>
            <a href="#jobs">Work with Us</a>
          </li>
          <li>
            <a href="#social">Contact</a>
          </li>
        </ul>
    );
  }

  const Header = () => {
    return (
      <div>
        <nav className="teal lighten-1" style={{position: 'fixed', top: '0px', zIndex: '99'}}>
          <div className="nav-wrapper">
            <a href="" className="brand-logo left">
              <img width="83px" height="50px" src={`${config.publicRuntimeConfig.cdnPrefix}static/img/color_logo_transparent.svg`} /></a>
            <a className='hide-on-large-only dropdown-trigger right'  href='#' data-target='mobile-view'>
              <div style={{marginTop: 10}}>
                <img width="32px" height="32px" src={`${config.publicRuntimeConfig.cdnPrefix}static/img/menu.png`} />
              </div>
            </a>
            <MenuList id="mobile-view" classes="dropdown-content" />
            <MenuList id="desktop-view" classes="right hide-on-med-and-down" />
          </div>
        </nav>
      </div>
    );
  };

export default Header;
